@heidikristoffer might have just unlocked the secret to actually liking the sound of your alarm clock.

Yogi, mom, and founder of @crossflow_yoga, Heidi makes the most of every minute of her mornings and starts them with the sweetest sound!

We’re curious, how many of you have customized your alarm clock sound vs. using the sounds your phone provides? #ShapeMorningCup
